import React from 'react';
import { useEffect, useState } from 'react';
import {
  AppBar,
  Box,
  Button,
  Container,
  IconButton,
  Paper,
  Typography,
} from '@mui/material'
import { useAuth0 } from '@auth0/auth0-react';
import { ArrowBack, Store } from '@mui/icons-material'
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { useGetCurrentUserWalletAccounts } from 'features/auth/queries';
import { CURRENCY, formatCurrencyAmount } from 'features/utils';
import { useQuery } from '@tanstack/react-query';
import { getFetchPaymentIntentQuery } from 'features/merchant/queries';

function Login() {
  const { loginWithRedirect } = useAuth0();

  const { data: walletAccounts } = useGetCurrentUserWalletAccounts();
  const paymentIntentId = window.location.pathname.split('/')?.[1];
  const { data: paymentIntent } = useQuery(
    getFetchPaymentIntentQuery(paymentIntentId)
  );

  const [amountToPay, setAmountToPay] = useState(0);
  const [description, setDescription] = useState('');

  useEffect(() => {
    if (paymentIntent) {
      setAmountToPay(paymentIntent?.requestedAmount || 0);
      setDescription(paymentIntent?.description || '');
    }
  }, [paymentIntent,walletAccounts]);

  const handleLoginWithGoogle = async () =>
    await loginWithRedirect({
      appState: {
        returnTo: window.location.pathname,
      },
    });

  if (!paymentIntent) {
    return <div>Loading...</div>;
  }

  return (
   /*  <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        backgroundColor: '#0f1e33',
        padding: 2,
        border: '3px solid #0f1e33',
        borderRadius: '8px',
      }}
    >
      <Card sx={{ maxWidth: 400, backgroundColor: '#e8f1fa', padding: 2 }}>
        <CardContent>
          <Typography variant="h5" color="primary" sx={{ fontWeight: 'bold' }}>
            Connect your Pitaka account to sign in.
          </Typography>
          <Box
            sx={{
              display: 'flex',
              justifyContent: 'center',
              marginTop: '30px',
            }}
          >
            <Button
              variant="contained"
              color="primary"
              onClick={handleLoginWithGoogle}
            >
              Single Sign-On (SSO)
            </Button>
          </Box>
        </CardContent>
      </Card>
    </Box>
 */


    <Container maxWidth="sm" sx={{ height: '100vh', bgcolor: '#f5f5f5', p: 0 }}>
    <Box sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
      <AppBar position="static" sx={{ bgcolor: '#1a2b4b', pb: 20 }}>
        <Box sx={{ 
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'flex-start',
          p: 2 }}
          >

          <IconButton edge="start" color="inherit" sx={{mt: 0}}>
            <ArrowBack />
          </IconButton>
          <Typography variant="h6" sx={{ mt: 2, mb: 2, ml: 2 }}>
            Pitaka Login
          </Typography>
        </Box>
        <Box
        sx={{ 
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          p: 2 }}
        >

          <Box sx={{ textAlign: 'center', mb: 2}}>
            <Paper
              sx={{
                display: 'inline-flex',
                alignItems: 'center',
                gap: 1,
                px: 2,
                py: 1,
                borderRadius: 20,
                bgcolor: '#F4F3FF',
              }}
            >
            <Store sx={{ fontSize: 16 }} />
              <Typography variant="body2">Merchant</Typography>
            </Paper>

            <Typography variant="h6" sx={{ mt: 2, mb: 1 }}>
              {description}
            </Typography>

            <Typography variant="h4" sx={{ fontWeight: 'bold' }}>
            {formatCurrencyAmount(amountToPay, CURRENCY.PHP)}
            </Typography>
          </Box>
        </Box>
      </AppBar>

      <Paper sx={{ p: 3, m: 2, mt: -15, borderRadius: 4, flexGrow: 0 }}>
        <Typography variant="h6" sx={{ mb: 2, textAlign: 'left' }}>
          Log in to pay with Pitaka
        </Typography>

        <Typography variant="subtitle2" color="text.secondary" sx={{ textAlign: 'left' }}>
          Wallet address
        </Typography>

        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mt: 1 }}>
          <AccountCircleIcon sx={{ width: 40, height: 40 }} />
          <Box sx={{ textAlign: 'left' }}>
            <Typography variant="subtitle1">Raff</Typography>
            <Typography variant="caption" color="text.secondary">
              123123etAccountNumber
            </Typography>
          </Box>
        </Box>

        <Button
          variant="contained"
          fullWidth
          sx={{
            mt: 2,
            bgcolor: '#5d7199',
            borderRadius: 2,
            py: 1.5,
            '&:hover': { bgcolor: '#4a5a7a' },
          }}
          onClick={handleLoginWithGoogle} 
        >
          Next
        </Button>
      </Paper>
    </Box>
    </Container>
  );
}

export default Login;
